import { createApp } from 'vue';
import Header from './Header.vue';
import Footer from './Footer.vue';
import Menu from './Menu.vue';

const app = createApp({});

app.component('Header', Header);
app.component('Footer', Footer);
app.component('Menu', Menu);

app.mount('#app');
